def transform(sequence):
    first_digit = sequence.find(next(filter(lambda x: x != '0', sequence)))
    last_digit = len(sequence) - sequence[::-1].find(next(filter(lambda x: x != '0', sequence[::-1]))) - 1
    return sequence[:first_digit] + '0' + sequence[first_digit:last_digit] + sequence[last_digit:].replace('0', '')
